import './css/nav.css';

function Nav(){
    return(
        <>
            <nav className="back-nav">
                <div >
                    <ul className="content-nav">
                        <li>To Do</li>
                        <li>Doing</li>
                        <li>Done</li>
                    </ul>
                </div>                
            </nav>
        </>
    );
}

export default Nav;
